webpackJsonp([0x5d4964dd40b6],{1250:function(A,e){A.exports={data:{site:{siteMetadata:{title:"Psyked: James' Web Development website",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/pokeproject-adventures-with-lego-bricks-5ffefc875a8f/index.md absPath of file >>> MarkdownRemark",html:'<p>A while ago now, I set out on a side project adventure, which I’ve previously documented <a href="https://medium.com/@psyked/pok%C3%A9project-adventures-with-lego-bricks-7f24c02f6d9d">in Part 1,</a> <a href="https://medium.com/@psyked/pok%C3%A9project-adventures-with-lego-bricks-cd9401091239">Part 2</a> and <a href="https://medium.com/@psyked/pok%C3%A9project-adventures-with-lego-bricks-c7b9b8385276">Part 3.</a> Finally though it’s time to make the leap into the real world and “eat my own dog food,” so to speak.</p>\n<hr>\n<p>For my first real world experiment I decided to recreate the Growlithe sprite in LEGO, using the plans and shopping list generated by the page: <a href="https://www.pokeproject.co.uk/lego/growlithe">https://www.pokeproject.co.uk/lego/growlithe</a></p>\n<p>I placed the order through the LEGO website, some nice people picked out all of the pieces I needed and shipped them over to me, and a week or so later I received the following package:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/1*UQAexRVxXNBzWz2efaNO2A-75c43ac6b31a5ca5069f8ad43242ee89-3a143.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 630px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="1 UQAexRVxXNBzWz2efaNO2A"\n        title=""\n        src="/static/1*UQAexRVxXNBzWz2efaNO2A-75c43ac6b31a5ca5069f8ad43242ee89-af57e.jpeg"\n        srcset="/static/1*UQAexRVxXNBzWz2efaNO2A-75c43ac6b31a5ca5069f8ad43242ee89-847f7.jpeg 158w,\n/static/1*UQAexRVxXNBzWz2efaNO2A-75c43ac6b31a5ca5069f8ad43242ee89-93973.jpeg 315w,\n/static/1*UQAexRVxXNBzWz2efaNO2A-75c43ac6b31a5ca5069f8ad43242ee89-af57e.jpeg 630w,\n/static/1*UQAexRVxXNBzWz2efaNO2A-75c43ac6b31a5ca5069f8ad43242ee89-28cf9.jpeg 945w,\n/static/1*UQAexRVxXNBzWz2efaNO2A-75c43ac6b31a5ca5069f8ad43242ee89-0d474.jpeg 1260w,\n/static/1*UQAexRVxXNBzWz2efaNO2A-75c43ac6b31a5ca5069f8ad43242ee89-3a143.jpeg 1600w"\n        sizes="(max-width: 630px) 100vw, 630px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>A whole bag of goodies, waiting to be assembled.</p>\n<p>Where to start? Knowing where to position the pieces is one of the first challenges — can’t go putting them straight onto a backing board if you’re not sure where the centre point is!</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/1*RZPjc-GqjVuK9Oq1nU-sGg-05a791fdcc78859ec4248f0e2b06b7fe-2f776.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 630px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="1 RZPjc GqjVuK9Oq1nU sGg"\n        title=""\n        src="/static/1*RZPjc-GqjVuK9Oq1nU-sGg-05a791fdcc78859ec4248f0e2b06b7fe-af57e.jpeg"\n        srcset="/static/1*RZPjc-GqjVuK9Oq1nU-sGg-05a791fdcc78859ec4248f0e2b06b7fe-847f7.jpeg 158w,\n/static/1*RZPjc-GqjVuK9Oq1nU-sGg-05a791fdcc78859ec4248f0e2b06b7fe-93973.jpeg 315w,\n/static/1*RZPjc-GqjVuK9Oq1nU-sGg-05a791fdcc78859ec4248f0e2b06b7fe-af57e.jpeg 630w,\n/static/1*RZPjc-GqjVuK9Oq1nU-sGg-05a791fdcc78859ec4248f0e2b06b7fe-28cf9.jpeg 945w,\n/static/1*RZPjc-GqjVuK9Oq1nU-sGg-05a791fdcc78859ec4248f0e2b06b7fe-0d474.jpeg 1260w,\n/static/1*RZPjc-GqjVuK9Oq1nU-sGg-05a791fdcc78859ec4248f0e2b06b7fe-66f39.jpeg 1890w,\n/static/1*RZPjc-GqjVuK9Oq1nU-sGg-05a791fdcc78859ec4248f0e2b06b7fe-2f776.jpeg 2000w"\n        sizes="(max-width: 630px) 100vw, 630px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Making a start…</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/1*PCiVkk-vLQjiMJSWizqDzA-b82d880ffb92d5c92598df3f01755207-3a143.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 630px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="1 PCiVkk vLQjiMJSWizqDzA"\n        title=""\n        src="/static/1*PCiVkk-vLQjiMJSWizqDzA-b82d880ffb92d5c92598df3f01755207-af57e.jpeg"\n        srcset="/static/1*PCiVkk-vLQjiMJSWizqDzA-b82d880ffb92d5c92598df3f01755207-847f7.jpeg 158w,\n/static/1*PCiVkk-vLQjiMJSWizqDzA-b82d880ffb92d5c92598df3f01755207-93973.jpeg 315w,\n/static/1*PCiVkk-vLQjiMJSWizqDzA-b82d880ffb92d5c92598df3f01755207-af57e.jpeg 630w,\n/static/1*PCiVkk-vLQjiMJSWizqDzA-b82d880ffb92d5c92598df3f01755207-28cf9.jpeg 945w,\n/static/1*PCiVkk-vLQjiMJSWizqDzA-b82d880ffb92d5c92598df3f01755207-0d474.jpeg 1260w,\n/static/1*PCiVkk-vLQjiMJSWizqDzA-b82d880ffb92d5c92598df3f01755207-3a143.jpeg 1600w"\n        sizes="(max-width: 630px) 100vw, 630px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Piece-by-piece and eventually recognisable shapes start to appear from the chaos.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/1*dQE1kFd2kA9Srvfl4tRqPA-46d1d5d1a8b57645c54138e792645d8e-2f776.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 630px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="1 dQE1kFd2kA9Srvfl4tRqPA"\n        title=""\n        src="/static/1*dQE1kFd2kA9Srvfl4tRqPA-46d1d5d1a8b57645c54138e792645d8e-af57e.jpeg"\n        srcset="/static/1*dQE1kFd2kA9Srvfl4tRqPA-46d1d5d1a8b57645c54138e792645d8e-847f7.jpeg 158w,\n/static/1*dQE1kFd2kA9Srvfl4tRqPA-46d1d5d1a8b57645c54138e792645d8e-93973.jpeg 315w,\n/static/1*dQE1kFd2kA9Srvfl4tRqPA-46d1d5d1a8b57645c54138e792645d8e-af57e.jpeg 630w,\n/static/1*dQE1kFd2kA9Srvfl4tRqPA-46d1d5d1a8b57645c54138e792645d8e-28cf9.jpeg 945w,\n/static/1*dQE1kFd2kA9Srvfl4tRqPA-46d1d5d1a8b57645c54138e792645d8e-0d474.jpeg 1260w,\n/static/1*dQE1kFd2kA9Srvfl4tRqPA-46d1d5d1a8b57645c54138e792645d8e-66f39.jpeg 1890w,\n/static/1*dQE1kFd2kA9Srvfl4tRqPA-46d1d5d1a8b57645c54138e792645d8e-2f776.jpeg 2000w"\n        sizes="(max-width: 630px) 100vw, 630px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>It’s actually the work of more than a few evenings to put this together.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/1*vJ4GLgd7aQ6D4npiimypIw-1508584f06a810c97c8c3c15ca2e7167-11e54.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 630px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="1 vJ4GLgd7aQ6D4npiimypIw"\n        title=""\n        src="/static/1*vJ4GLgd7aQ6D4npiimypIw-1508584f06a810c97c8c3c15ca2e7167-af57e.jpeg"\n        srcset="/static/1*vJ4GLgd7aQ6D4npiimypIw-1508584f06a810c97c8c3c15ca2e7167-847f7.jpeg 158w,\n/static/1*vJ4GLgd7aQ6D4npiimypIw-1508584f06a810c97c8c3c15ca2e7167-93973.jpeg 315w,\n/static/1*vJ4GLgd7aQ6D4npiimypIw-1508584f06a810c97c8c3c15ca2e7167-af57e.jpeg 630w,\n/static/1*vJ4GLgd7aQ6D4npiimypIw-1508584f06a810c97c8c3c15ca2e7167-28cf9.jpeg 945w,\n/static/1*vJ4GLgd7aQ6D4npiimypIw-1508584f06a810c97c8c3c15ca2e7167-11e54.jpeg 1200w"\n        sizes="(max-width: 630px) 100vw, 630px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Finally — ta-dah! — it’s finally visible at full size.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/1*iAxdXgzqVRM6t42u9BdIYg-8795407846854f49ac880515bc72f7d8-2f776.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 630px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="1 iAxdXgzqVRM6t42u9BdIYg"\n        title=""\n        src="/static/1*iAxdXgzqVRM6t42u9BdIYg-8795407846854f49ac880515bc72f7d8-af57e.jpeg"\n        srcset="/static/1*iAxdXgzqVRM6t42u9BdIYg-8795407846854f49ac880515bc72f7d8-847f7.jpeg 158w,\n/static/1*iAxdXgzqVRM6t42u9BdIYg-8795407846854f49ac880515bc72f7d8-93973.jpeg 315w,\n/static/1*iAxdXgzqVRM6t42u9BdIYg-8795407846854f49ac880515bc72f7d8-af57e.jpeg 630w,\n/static/1*iAxdXgzqVRM6t42u9BdIYg-8795407846854f49ac880515bc72f7d8-28cf9.jpeg 945w,\n/static/1*iAxdXgzqVRM6t42u9BdIYg-8795407846854f49ac880515bc72f7d8-0d474.jpeg 1260w,\n/static/1*iAxdXgzqVRM6t42u9BdIYg-8795407846854f49ac880515bc72f7d8-66f39.jpeg 1890w,\n/static/1*iAxdXgzqVRM6t42u9BdIYg-8795407846854f49ac880515bc72f7d8-2f776.jpeg 2000w"\n        sizes="(max-width: 630px) 100vw, 630px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>And there we have it; finally transferred onto backing boards, and at an imposing size, roughly 48 x 48cm, and unfortunately possibly too big to display on the wall as intended!</p>\n<hr>\n<h4>Concluding</h4>\n<p>It’s been a fun journey creating <a href="https://www.pokeproject.co.uk/">PokéProject,</a> and I’m pleased by the results of the conversion from Sprite to LEGO. Not all of the sprites work and produce the same quality of output, but part of my reason for picking Growlithe as my real world test was to see how well it looks in the flesh — with a mix of Olive Greens used in the place of Grey, and Orange and Yellows in the place of lighter Reds.</p>\n<p>Each ‘pixel’ in the final image are 8mm in real life, and this size makes it particularly good as an image to be viewed from a distance, but it also puts a limit on the size of the images you can use. Finding a source image that works with such scale is a challenge!</p>',frontmatter:{title:"PokéProject: Adventures with LEGO Bricks",date:"October 04, 2017",tags:["Lego","Pokemon","Side Project"],url:"https://medium.com/@psyked/pok%C3%A9project-adventures-with-lego-bricks-5ffefc875a8f",image:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.3333333333333333,src:"/static/1*vJ4GLgd7aQ6D4npiimypIw-1508584f06a810c97c8c3c15ca2e7167-f2ac0.jpeg",srcSet:"/static/1*vJ4GLgd7aQ6D4npiimypIw-1508584f06a810c97c8c3c15ca2e7167-567e3.jpeg 158w,\n/static/1*vJ4GLgd7aQ6D4npiimypIw-1508584f06a810c97c8c3c15ca2e7167-c3206.jpeg 315w,\n/static/1*vJ4GLgd7aQ6D4npiimypIw-1508584f06a810c97c8c3c15ca2e7167-f2ac0.jpeg 630w,\n/static/1*vJ4GLgd7aQ6D4npiimypIw-1508584f06a810c97c8c3c15ca2e7167-0c4a5.jpeg 945w,\n/static/1*vJ4GLgd7aQ6D4npiimypIw-1508584f06a810c97c8c3c15ca2e7167-4e530.jpeg 1200w",sizes:"(max-width: 630px) 100vw, 630px"}}},description:"Part Four: Into the real world."}}},pathContext:{prev:{frontmatter:{path:"/blog/thought-leadership/",tags:null,title:"Thought Leadership",date:"2017-09-30T20:12:57.000Z"}},next:{frontmatter:{path:"/blog/3-hour-hacks/",tags:["Hackaday","Side Project","Inspiration"],title:"3 hour hacks",date:"2018-03-11T10:41:36.819Z"}}}}}});
